###################################
# Image and Pixels representation #
###################################

from random import randint
from tkinter import *
from PIL import Image

def _pxl(val): #Checks for proper inputs, will learn later on
    if not isinstance(val, int):
        raise TypeError("Color must be integer") 
    if not 0 <= val <= 255:
        raise ValueError("Color must be between 0 and 255 (inclusive)")
    
############ PIXEL 0 #############

def _make_pixel_0(r, g, b):
    """
    Create a new "Pixel" with the given color specified
    as `red`, `green`, and `blue`.
    """
    _pxl(r)
    _pxl(g)
    _pxl(b)
    return (r, g, b)

def _get_r_0(pixel):
    """
    Get the red color from the `pixel`.
    """
    return pixel[0]

def _get_g_0(pixel):
    """
    Get the green color from the `pixel`.
    """
    return pixel[1]

def _get_b_0(pixel):
    """
    Get the blue color from the `pixel`.
    """
    return pixel[2]


############ PIXEL 1 #############

def _make_pixel_1(r, g, b):
    """
    Create a new "Pixel" with the given color specified
    as `red`, `green`, and `blue`.
    """
    _pxl(r)
    _pxl(g)
    _pxl(b)
    return {'r': r, 'g': g, 'b': b} # you will learn this after recess

def _get_r_1(pixel):
    """
    Get the red color from the `pixel`.
    """
    return pixel['r']

def _get_g_1(pixel):
    """
    Get the green color from the `pixel`.
    """
    return pixel['g']

def _get_b_1(pixel):
    """
    Get the blue color from the `pixel`.
    """
    return pixel['b']

