############ IMAGE 0 #############

def _make_image_0(width, height):
    """
    Create a new "Image" with the given `width` and `height`
    such that each pixel is the the default WHITE pixel.
    """
    image = ()
    for _row in range(height):
        rows = ()
        for _col in range(width):
            rows = rows + (WHITE,)
        image = image + (rows,)
    return image

def _get_pixel_0(image, row, col):
    """
    Get the "Pixel" from the `image` at the given `row` and `col`.
    """
    return image[row][col]

def _set_pixel_0(image, row, col, pixel):
    """
    Create a new "Image" with the same size such that the
    "Pixel" at the given `row` and `col` is `pixel`.
    Does not modify other pixels.
    """
    res = ()
    for _row in range(len(image)):
        rows = ()
        for _col in range(len(image[0])):
            if _row == row and _col == col:
                rows = rows + (pixel,)
            else:
                rows = rows + (image[_row][_col],)
        res = res + (rows,)
    return res

def _get_height_0(image):
    """
    Get the height of the `image`.
    """
    return len(image)

def _get_width_0(image):
    """
    Get the width of the `image`.
    """
    return len(image[0])

def _get_data_0(image):
    data = []
    for _row in range(len(image)):
        rows = []
        for _col in range(len(image[0])):
            rows.append(image[_row][_col])
        data.append(rows)
    return data


############ IMAGE 1 #############

def _make_image_1(width, height):
    """
    Create a new "Image" with the given `width` and `height`
    such that each pixel is the the default WHITE pixel.
    """
    image = {'w': width, 'h': height, 'd': {}} # you will learn this after recess
    for _row in range(image['h']):
        for _col in range(image['w']):
            image['d'][(_row, _col)] = WHITE
    return image

def _get_pixel_1(image, row, col):
    """
    Get the "Pixel" from the `image` at the given `row` and `col`.
    """
    return image['d'][(row, col)]

def _set_pixel_1(image, row, col, pixel):
    """
    Create a new "Image" with the same size such that the
    "Pixel" at the given `row` and `col` is `pixel`.
    Does not modify other pixels.
    """
    res = _make_image_1(image['w'], image['h'])
    for _row in range(image['h']):
        rows = ()
        for _col in range(image['w']):
            if _row == row and _col == col:
                res['d'][(_row, _col)] = pixel
            else:
                res['d'][(_row, _col)] = image['d'][(_row, _col)]
    return res

def _get_height_1(image):
    """
    Get the height of the `image`.
    """
    return image['h']

def _get_width_1(image):
    """
    Get the width of the `image`.
    """
    return image['w']

def _get_data_1(image):
    data = []
    for _row in range(image['h']):
        rows = []
        for _col in range(image['w']):
            rows.append(image['d'][(_row, _col)])
        data.append(rows)
    return data

